import './App.scss';
import Brainflix from './components/Brainflix/Brainflix';
import { BrowserRouter, Route, Switch} from 'react-router-dom'

function App() {
  return (
    <div className="App">
		<BrowserRouter>
			<Switch>
				<Route path='/' component={Brainflix} />
				<Route path='/:id' component={Brainflix} />
			</Switch>
		</BrowserRouter>
    </div>
  );
}

export default App;
